import React from 'react';
import {Link} from 'react-router-dom';
import './navbar.css'
const Navbar = () => {
  return (
    <div>
    <div className='head'>
    <img className='logo' height="100" width="140" src="https://vtlogo.com/wp-content/uploads/2020/12/influencer-vector-logo.png" alt="logo"/>
    
    <Link to='/'>Home</Link>
    <button style={text}><Link to='/login'>Login</Link></button>
    <button><Link to='/register'>Register</Link></button>
    
    </div>
</div>
    
  )
}

export default Navbar
